import Screen from "./Screen.png"
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
      <img src={Screen} className="App-logo" alt="fullstack"/>
        <p>
          Louis Thomas Presents...
        </p>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          My Portfolio
        </a>
      </header>

    </div>
  );
}

export default App;
